import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 55.1-356 Words \\"with general warranty,\\" \\"with special warranty,\\" and \\"with English covenants of title\\" construed.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/55.1-356.md","filePath":"vacode/55.1-356.md"}'),r={name:"vacode/55.1-356.md"},n=o('<h1 id="§-55-1-356-words-with-general-warranty-with-special-warranty-and-with-english-covenants-of-title-construed" tabindex="-1">§ 55.1-356 Words &quot;with general warranty,&quot; &quot;with special warranty,&quot; and &quot;with English covenants of title&quot; construed. <a class="header-anchor" href="#§-55-1-356-words-with-general-warranty-with-special-warranty-and-with-english-covenants-of-title-construed" aria-label="Permalink to &quot;§ 55.1-356 Words &quot;with general warranty,&quot; &quot;with special warranty,&quot; and &quot;with English covenants of title&quot; construed.&quot;">​</a></h1><p>The words &quot;with general warranty&quot; in the granting part of any deed shall be deemed to be a covenant by the grantor &quot;that he will warrant generally the property hereby conveyed.&quot; The words &quot;with special warranty&quot; in the granting part of any deed shall be deemed to be a covenant by the grantor &quot;that he will warrant specially the property hereby conveyed.&quot;</p><p>The words &quot;with English covenants of title&quot; or words of similar import in the granting part of any deed shall be deemed to be an expression by the grantor of those covenants set out in §§ <a href="/vacode/55.1-359/">55.1-359</a> through <a href="/vacode/55.1-362/">55.1-362</a>, and in addition thereto the covenant that he is seized in fee simple of the property conveyed.</p><p>Code 1919, § 5173; Code 1950, § 55-70; 1968, c. 257; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712" target="_blank" rel="noreferrer">712</a>.</p>',4),i=[n];function s(h,d,l,c,w,p){return t(),a("div",null,i)}const g=e(r,[["render",s]]);export{_ as __pageData,g as default};
